import React from 'react';

const OfferListComponent = () => {
    const offers = [
        { id: 1, offerTitle: 'Offer 1', companyName: 'Company 1', categories: 'Category 1', salary: '$100,000', companyPhoto: 'company1.jpg' },
        { id: 2, offerTitle: 'Offer 2', companyName: 'Company 2', categories: 'Category 2', salary: '$80,000', companyPhoto: 'company2.jpg' },
        { id: 3, offerTitle: 'Offer 3', companyName: 'Company 3', categories: 'Category 3', salary: '$120,000', companyPhoto: 'company3.jpg' },
      ];

  return (
    <div className="list-offer" style={{ backgroundColor: '#ddd', margin: '0 auto', maxWidth: '80%', padding: '20px' }}>
      <h2 style={{ textAlign: 'center' }}>Offers</h2>
      <ul style={{ listStyle: 'none', padding: '0' }}>
        {offers.map((offer) => (
          <li key={offer.id}>{offer.title}</li>
        ))}
      </ul>
    </div>
  );
};

export default OfferListComponent;
